import React from 'react';
import './services.css'
const Services = () => {
    return ( 
        <>
        <h1 className="text-center">Services</h1>
        div.cont
        <div className="row">
         <div className="col-4">
             <div className="card">
                 <div className="card-body">
                 <i class="fas fa-paint-brush i"></i>
                 </div>
             </div>
         </div>
        </div>
        </>
         );
}
 
export default Services;
